const Todo = () => {
  return (
    <div className="w-full bg-gray-100 rounded-lg flex flex-col items-center justify-center p-3">
      <div className="flex items-center justify-between w-full">
        <div className="w-[15%]">
          <HiTrash className="pointer" />
        </div>
        <div className="w-[85%] flex justify-end">
          <span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans">school</span>
          <span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans">school</span>
        </div>
      </div>
    </div>
  );
}

export default Todo;
